import React, { useState, useEffect } from 'react';
import { OpenAI } from 'openai';
import axios from 'axios';

function App() {
  const [generatedQuestion, setGeneratedQuestion] = useState('');
  const [formData, setFormData] = useState({
    soru: '',
    dogru_cevap: '',
    yanlis_cevap1: '',
    yanlis_cevap2: '',
    yanlis_cevap3: '',
    tur: '',
    zorluk_seviyesi: 1, // Varsayılan olarak 1
  });

  const apiKey = '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'; // OpenAI API anahtarınızı buraya ekleyin

  const api = new OpenAI({
    apiKey,
    dangerouslyAllowBrowser: true,
  });

  const createAndSendQuestion = async () => {
    const soru =
      'Bana sadece 1 adet soru üret. sorunun konuları tarih, coğrafya, bilim, mantık matematik ve futbol ile alakalı olsun. soruları olabildiğince zor sor. temel sorular olmasın. zorluk seviyesini belirtirken bilinirliğe göre 1 ila 5 arasında puanla bu şekilde yazmanı istiyorum: |Soru| |Doğru cevap| |Yanlış cevap 1| |Yanlış cevap 2| |Yanlış cevap 3| |Tür| |Zorluk seviyesi| örnek verecek olursam: |Kösedağ savaşaı hangi iki devlet arasında olmuştur| | Anadolu SELÇUKLU-MOĞOL| |GAZNELİ-SELÇUKLU| |Azerbaycan -ermenistan| |nijerya-bangladeş| |tARİH | |2|';

    try {
      const completion = await api.chat.completions.create({
        messages: [{ role: 'system', content: soru }, { role: 'user', content: '' }],
        model: 'gpt-3.5-turbo',
      });

      const aiResponse = completion.choices[0].message.content;
      console.log(`AI: ${aiResponse}`);
      const veriler = aiResponse.split('|');

      const a = veriler[1];
      const dogru_cevap = veriler[3];
      const yanlis_cevap_1 = veriler[5];
      const yanlis_cevap_2 = veriler[7];
      const yanlis_cevap_3 = veriler[9];
      const tur = veriler[11];
      const zorlukSeviyesi = veriler[13];

      console.log(a);
      console.log(dogru_cevap);
      console.log(yanlis_cevap_1);
      console.log(yanlis_cevap_2);
      console.log(yanlis_cevap_3);
      console.log(tur);
      console.log(zorlukSeviyesi);

      setFormData({
        soru: a,
        dogru_cevap,
        yanlis_cevap1: yanlis_cevap_1,
        yanlis_cevap2: yanlis_cevap_2,
        yanlis_cevap3: yanlis_cevap_3,
        tur,
        zorluk_seviyesi: parseInt(zorlukSeviyesi, 10), // Sayıya çevir
      });

      return aiResponse;
    } catch (error) {
      console.error('Hata oluştu:', error);
      return '';
    }
  };

  const handleAddQuestion = async () => {
    try {
      const response1 = await axios.post('http://localhost:5000/create_question', formData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log(response1.data);
    } catch (error) {
      console.error('Hata oluştu:', error);
    }
  };

  useEffect(() => {
    const fetchData = async () => {
      const generatedQuestion = await createAndSendQuestion();
      setGeneratedQuestion(generatedQuestion);
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>Soru Oluşturma Uygulaması</h1>
      <button onClick={handleAddQuestion}>Soru Ekle</button>
      <div>
        <h2>Oluşturulan Soru:</h2>
        <p>{generatedQuestion}</p>
      </div>
      <div>
        <input
          type="text"
          placeholder="Soru"
          value={formData.soru}
          onChange={(e) => setFormData({ ...formData, soru: e.target.value })}
        />
        <input
          type="text"
          placeholder="Doğru Cevap"
          value={formData.dogru_cevap}
          onChange={(e) => setFormData({ ...formData, dogru_cevap: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 1"
          value={formData.yanlis_cevap1}
          onChange={(e) => setFormData({ ...formData, yanlis_cevap1: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 2"
          value={formData.yanlis_cevap2}
          onChange={(e) => setFormData({ ...formData, yanlis_cevap2: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 3"
          value={formData.yanlis_cevap3}
          onChange={(e) => setFormData({ ...formData, yanlis_cevap3: e.target.value })}
        />
        <input
          type="text"
          placeholder="Tür"
          value={formData.tur}
          onChange={(e) => setFormData({ ...formData, tur: e.target.value })}
        />
        <input
          type="number"
          placeholder="Zorluk Seviyesi"
          value={formData.zorluk_seviyesi}
          onChange={(e) => setFormData({ ...formData, zorluk_seviyesi: parseInt(e.target.value, 10) })}
        />
      </div>
    </div>
  );
}

export default App;
